import React, { Component } from 'react';

class TodoList extends Component {
  render () {
    return (
      <div>
        <h1> Ma Todo List : </h1>
          <form>
            <input text="text" placeholder="Renseigner un item"/>
            <button> Ajouter </button>
          </form>
      </div>
    );
  }
}

export default TodoList;
